import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faCoffee, faBuilding } from '@fortawesome/free-solid-svg-icons'

class Main extends React.Component {
  render() {
      return (
      <div className="fondo-app">
        <div className="home__centro-gestion shadow">
          <div className="home__centro-gestion__titulo flex shadow">
            <FontAwesomeIcon icon={faBuilding} />
            <p>Paseo Colina</p>
          </div>
          <div className="home__centro-gestion__boton">
            <p>Cambiar centro de gestion</p>
          </div>
        </div>
        <div>

        </div>
        <div></div>
      </div>
      );
  }
}

export default Main;
